namespace UnitTest.Medium
{
    using FluentAssertions;
    using LeetCode.Medium;
    using Microsoft.VisualStudio.TestTools.UnitTesting;

    [TestClass]
    public class FindAnagramsTest
    {
        private readonly Solution _solution = new Solution();

        [TestMethod]
        public void Test1()
        {
            _solution.FindAnagrams("cbaebabacd", "abc").Should().Equal(0, 6);
        }

        [TestMethod]
        public void Test2()
        {
            var t = "";
            var z = "";
            _solution.FindAnagrams(t, z).Should().Equal(0, 10001);
        }

        [TestMethod]
        public void Test3()
        {
            var t = "aecbabedce";
            var z = "a";
            _solution.FindAnagrams(t, z).Should().Equal(0, 4);
        }
    }
}
